import React, { Component } from 'react';
import { Container, Row, Col, Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';

class LoginForm extends Component {
    render() {
        return (
            <div>
                <Container>
                    <Row>
                        <Col md={{size: 6, offset: 3}}>
                            <h1>Log In</h1>
                        </Col>
                    </Row> 
                </Container>
            </div>
        );
    }
}

export default LoginForm;
